import axios from "axios";
import React from "react";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import { Navigate } from "react-router-dom";

const UserForm = () => {
  const handle = (event) => {
    alert("An essay was submitted: " + this.state.title);
    event.preventDefault();
  };
  return (
    <Form onSubmit={handle}>
      <Form.Group className="mb-3" controlId="formBasicEmail">
        <Form.Label>Title </Form.Label>
        <Form.Control name="title" type="text" placeholder="Enter Title" />
      </Form.Group>
      <Form.Group className="mb-3" controlId="formBasicEmail">
        <Form.Label>Description </Form.Label>
        <Form.Control name="body" type="text" placeholder="Enter Description" />
      </Form.Group>
      <Form.Group className="mb-3" controlId="formBasicEmail">
        <Form.Label>User Id</Form.Label>
        <Form.Control name="userid" type="text" placeholder="Enter UserId" />
      </Form.Group>

      <Button variant="primary" type="submit" id="formdata">
        Submit
      </Button>
    </Form>
  );
};

class RegisterForm extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }
   navigate = useNavigate()


  handleChange(event) {
    this.setState({ value: event.target.value });
  }
  handleSubmit(event) {
    const name = event.target.name.value;
    const email = event.target.email.value;
    const passowrd = event.target.passowrd.value;

    event.preventDefault();
    axios
      .post("https://jsonplaceholder.typicode.com/posts", {
        name: name,
        email: email,
        passowrd: passowrd,
      })
      .then((res) => {
        console.log("resssssssssssssss", res);
      })
      .catch((err) => {
        console.log("errrrrrrrrr", err);
      });
  }

  render() {
    return (
      <Form onSubmit={this.handleSubmit}>
        <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label>name </Form.Label>
          <Form.Control
            name="name"
            value={this.state.name}
            type="text"
            placeholder="Enter name"
          />
        </Form.Group>
        <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label>email </Form.Label>
          <Form.Control
            name="email"
            type="email"
            value={this.state.email}
            placeholder="Enter Description"
          />
        </Form.Group>
        <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label>password</Form.Label>
          <Form.Control
            name="passowrd"
            type="password"
            value={this.state.passowrd}
            placeholder="Enter passowrd"
          />
        </Form.Group>

        <Button variant="primary" type="submit" id="formdata">
          Submit
        </Button>
      </Form>
    );
  }
}

export { UserForm, RegisterForm };
